export function isInternalUser() {
  //if (import.meta.env.DEV) return true;

  const auth = pipe(
    getAuthentication(),
    Effect.provideLayer(SessionStorageLive),
    Effect.either,
    Effect.runSync
  );

  return E.isRight(auth) || (isOnInternalUrl && E.isRight(auth));
}

